/****** Object:  UserDefinedFunction [DataTransfer].[tvf_SalesByYear]    Script Date: 5/1/2022 1:00:49 AM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE FUNCTION [DataTransfer].[tvf_SalesByYear]
(
    @TargetYear INT
)
RETURNS TABLE
AS
RETURN
(
    SELECT MK.[MakeName],
           MD.[ModelName],
           CUST.[CustomerName],
           C.[CountryName],
           STKD.[Cost],
           STKD.[RepairCost] AS [RepairsCost],
           STKD.[PartCost] AS [PartsCost],
           STKD.[TransportInCost],
           SD.[SalePrice],
           SL.[SaleDate],
           2 AS UserAuthorizationKey,
           CAST(SYSDATETIME() AS DATE) AS DateAdded,
           CAST(SYSDATETIME() AS DATE) AS DateOfLastUpdate
    FROM [Data].[SaleDetail] AS SD
        INNER JOIN [Data].[Stock] AS STK
            ON SD.StockID = STK.StockID
        INNER JOIN [Data].[StockDetail] AS STKD
            ON STK.StockID = STKD.StockID
        INNER JOIN [Data].[Model] AS MD
            ON STKD.ModelID = MD.ModelID
        INNER JOIN [Data].[Make] AS MK
            ON MD.MakeID = MK.MakeID
        INNER JOIN [Data].[Sale] AS SL
            ON SD.SaleID = SL.SaleID
        INNER JOIN [Data].[Customer] AS CUST
            ON SL.CustomerID = CUST.CustomerID
        INNER JOIN [Data].[Address] AS ADDR
            ON ADDR.CustomerID = CUST.CustomerID
        INNER JOIN [Data].[Town] AS T
            ON T.TownId = ADDR.TownID
        INNER JOIN Data.Country AS C
            ON C.CountryID = T.CountryId
    WHERE YEAR(SL.SaleDate) = @TargetYear
);
GO
