/****** Object:  View [Reference].[uvw_MarketingCategories]    Script Date: 5/1/2022 1:00:49 AM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE VIEW [Reference].[uvw_MarketingCategories]
AS
SELECT MakeName,
       CASE
           WHEN MakeName IN ( 'Ferrari', 'Lamborghini', 'Alfa Romeo', 'Bugatti', 'Lagonda', 'McLaren', 'Morgan',
                              'Noble', 'Triumph'
                            ) THEN
               'Sports'
           WHEN MakeName IN ( 'Citroen', 'Delahaye', 'Trabant', 'Peugeot', 'Reliant', 'Riley', 'Cadillac' ) THEN
               'Family'
           WHEN MakeName = 'Austin' THEN
               'Relic'
           WHEN MakeName IN ( 'Porsche', 'Aston Martin', 'Mercedes', 'BMW' ) THEN
               'Sports,Tourer'
           WHEN MakeName IN ( 'Delorean', 'Jaguar' ) THEN
               'Sports,Family'
           WHEN MakeName IN ( 'Rolls Royce', 'Maybach' ) THEN
               'Chauffer,Prestige'
           WHEN MakeName = 'Bentley' THEN
               'Tourer,Chauffer,Prestige'
           ELSE
               'Unknown'
       END AS MarketingType,
       3 AS UserAuthorizationKey,
       CAST(SYSDATETIME() AS DATE) AS DateAdded,
       CAST(SYSDATETIME() AS DATE) AS DateOfLastUpdate
FROM [Data].Make;
GO
/****** Object:  UserDefinedFunction [Reference].[tvf_YearlySales]    Script Date: 5/1/2022 1:00:49 AM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE FUNCTION [Reference].[tvf_YearlySales]
(
    @TargetYear INT
)
RETURNS TABLE
AS
RETURN
(
    SELECT make.[MakeName],
           model.[ModelName],
           customer.[CustomerName],
           country.[CountryName],
           stkdetail.[Cost],
           stkdetail.[RepairCost] AS [RepairsCost],
           stkdetail.[PartCost] AS [PartsCost],
           stkdetail.[TransportInCost],
           saledetail.[SalePrice],
           sale.[SaleDate],
           4 AS UserAuthorizationKey,
           CAST(SYSDATETIME() AS DATE) AS DateAdded,
           CAST(SYSDATETIME() AS DATE) AS DateOfLastUpdate
    FROM [Data].[Sale] AS sale
        INNER JOIN [Data].[SaleDetail] AS saledetail
            ON sale.SaleID = saledetail.SaleID
        INNER JOIN [Data].[StockDetail] AS stkdetail
            ON saledetail.StockID = stkdetail.StockID
        INNER JOIN [Data].[Model] AS model
            ON stkdetail.ModelID = model.ModelID
        INNER JOIN [Data].[Make] AS make
            ON model.MakeID = make.MakeID
        INNER JOIN [Data].[Customer] AS customer
            ON sale.CustomerID = customer.CustomerID
        INNER JOIN [Data].[Address] AS addy
            ON customer.CustomerID = addy.CustomerID
        INNER JOIN [Data].[Town] AS town
            ON addy.TownID = town.TownId
        INNER JOIN [Data].[Country] AS country
            ON town.CountryId = country.CountryID
    WHERE YEAR(sale.SaleDate) = @TargetYear
);

GO
